    description: "La pi\xF9 pregiata e diffusa variet\xE0 campana \xE8 la Sorrento,\
      \ originaria della penisola sorrentina, che col tempo ha dato luogo a un'ampia\
      \ gamma di biotipi, tutti commercialmente noti come Noce di Sorrento. I due\
      \ ecotipi pi\xF9 diffusi sono: uno allungato, regolare, leggermente appuntito\
      \ all'apice e smussato alla base, l'altro rotondeggiante, pi\xF9 piccolo. Le\
      \ valve, in entrambi i casi, sono lisce, di ridotto spessore, il frutto \xE8\
      \ costituito dal gheriglio di sapore gradevolissimo, poco oleoso di colore bianco\
      \ crema. Una delle principali caratteristiche \xE8 che, a differenza delle altre\
      \ cultivar il gheriglio pu\xF2 facilmente essere estratto integro, cosa che\
      \ la rende particolarmente apprezzato dall'industria dolciaria e dai consumatori.\
      \ La raccolta si concentra nei mesi di settembre e ottobre con una resa estremamente\
      \ variabile, anche in considerazione delle condizioni nelle quali si trova la\
      \ coltura."
